package introduce.myteam.domain.userimport jakarta.persistence.*@Entity@Table(name = "users")class User(name: String, description: String, githubUrl: String, blogUrl: String) {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    @Column(name = "user_id")    var id: Long = 0        protected set    @Column(nullable = false)    var name: String = name        protected set    @Column(nullable = false)    var description: String = description        protected set    @Column(name = "github_url")    var githubUrl: String = githubUrl        protected set    @Column(name = "blog_url")    var blogUrl: String = blogUrl        protected set}